import React, { useState } from "react";
import "./Homepage.css";

const citiesInPakistan = [
  "Islamabad",
  "Lahore",
  "Karachi",
  "Murree",
  "Peshawar",
  "Skardu",
  "Hunza",
  "Quetta",
  "Multan",
  "Faisalabad",
];

const Homepage = () => {
  const [startingPoint, setStartingPoint] = useState("");
  const [destination, setDestination] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  const handleSearch = () => {
    // Perform the search logic here
    console.log("Search submitted with:", {
      startingPoint,
      destination,
      startDate,
      endDate,
    });
  };

  const [tripPreferences, setTripPreferences] = useState("");
  const [aiTripPlan, setAiTripPlan] = useState(null);

  const handleAITripPlanning = () => {
    // Simulate AI trip planning (this can be replaced with actual API calls)
    const generatedTripPlan = `AI has generated the following trip: 
      Starting from ${startingPoint || "Islamabad"}, travel to ${
      destination || "Skardu"
    } from ${startDate || "2024-09-01"} to ${
      endDate || "2024-09-10"
    }. Your preferences: ${tripPreferences}.`;

    setAiTripPlan(generatedTripPlan);
  };

  return (
    <div className="homepage">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-overlay">
          <div className="hero-content">
            <h1>Explore Beautiful Cities in Pakistan</h1>
            <p>Discover the beauty of Pakistan with Voyaige Travel</p>

            {/* Advanced Search Form */}
            <div className="search-form">
              {/* Starting Point Dropdown */}
              <select
                value={startingPoint}
                onChange={(e) => setStartingPoint(e.target.value)}
                className="dropdown"
              >
                <option value="" disabled>
                  Starting Point
                </option>
                {citiesInPakistan.map((city) => (
                  <option key={city} value={city}>
                    {city}
                  </option>
                ))}
              </select>

              {/* Destination Dropdown */}
              <select
                value={destination}
                onChange={(e) => setDestination(e.target.value)}
                className="dropdown"
              >
                <option value="" disabled>
                  Destination
                </option>
                {citiesInPakistan.map((city) => (
                  <option key={city} value={city}>
                    {city}
                  </option>
                ))}
              </select>

              {/* Date Selection */}
              <input
                type="date"
                value={startDate}
                onChange={(e) => setStartDate(e.target.value)}
                className="date-picker"
              />
              <input
                type="date"
                value={endDate}
                onChange={(e) => setEndDate(e.target.value)}
                className="date-picker"
              />

              {/* Search Button */}
              <button onClick={handleSearch} className="search-button">
                Search
              </button>
            </div>
          </div>
        </div>
      </section>

      {/* Featured Cities in Pakistan Section */}
      <section className="featured-section">
        <h2>Featured Cities in Pakistan</h2>
        <div className="destinations">
          <div className="destination-card">
            <img
              src="https://flypakistan.pk/assets/img/blog/Explore%20The%20Best%20Places%20To%20Visit%20In%20Islamabad%20-%20Islamabad%20Attractions.jpg"
              alt="Islamabad"
            />
            <div className="destination-info">
              <h3>Islamabad</h3>
              <p>
                Experience the capital city with its serene landscapes and rich
                culture.
              </p>
            </div>
          </div>

          <div className="destination-card">
            <img
              src="https://i.tribune.com.pk/media/images/2137970-minarepakistanx-1579108090/2137970-minarepakistanx-1579108090.jpg"
              alt="Lahore"
            />
            <div className="destination-info">
              <h3>Lahore</h3>
              <p>Discover the historical beauty and vibrant life of Lahore.</p>
            </div>
          </div>

          <div className="destination-card">
            <img
              src="https://cdn.britannica.com/85/128585-050-5A1BDD02/Karachi-Pakistan.jpg"
              alt="Karachi"
            />
            <div className="destination-info">
              <h3>Karachi</h3>
              <p>Explore the bustling metropolis by the sea, Karachi.</p>
            </div>
          </div>

          <div className="destination-card">
            <img
              src="https://tourism.punjab.gov.pk/system/files/styles/dp_internal_fi/private/gali2.jpg?itok=EQV4LIAN"
              alt="Murree"
            />
            <div className="destination-info">
              <h3>Murree</h3>
              <p>Enjoy the scenic hills and cool weather of Murree.</p>
            </div>
          </div>
        </div>
      </section>

      {/* Promotional Tours in Pakistan */}
      <section className="promo-section">
        <h2>Special Tours & Offers in Pakistan</h2>
        <div className="promo-tours">
          <div className="promo-card">
            <img
              src="https://dynamic-media-cdn.tripadvisor.com/media/photo-o/0d/39/26/f2/upper-kachura-lake-is.jpg?w=600&h=500&s=1"
              alt="Skardu Adventure"
            />
            <div className="promo-info">
              <h3>Skardu Adventure</h3>
              <p>
                7 days, all-inclusive tour to the breathtaking valleys of Skardu.
              </p>
              <button>Book Now</button>
            </div>
          </div>

          <div className="promo-card">
            <img
              src="https://gulmitcontinentalhotel.com/wp-content/uploads/2022/10/Autum-season-in-Hunza-Valley.jpg"
              alt="Hunza Valley Escape"
            />
            <div className="promo-info">
              <h3>Hunza Valley Escape</h3>
              <p>Experience 5 days of serenity in the enchanting Hunza Valley.</p>
              <button>Book Now</button>
            </div>
          </div>
        </div>
      </section>

      {/* AI Trip Planner Section */}
      <section className="ai-trip-planner">
        <h2>Plan Your Trip Using AI</h2>
        <div className="ai-planner-form">
          {/* Trip Preferences Input */}
          <textarea
            placeholder="Enter your trip preferences (e.g., adventure, relaxation, historical sites)"
            value={tripPreferences}
            onChange={(e) => setTripPreferences(e.target.value)}
            className="preferences-input"
          ></textarea>

          {/* Plan Trip Button */}
          <button onClick={handleAITripPlanning} className="plan-trip-button">
            Plan My Trip
          </button>

          {/* Display AI Generated Trip Plan */}
          {aiTripPlan && (
            <div className="ai-trip-plan-result">
              <h3>Your AI-Generated Trip Plan</h3>
              <p>{aiTripPlan}</p>
            </div>
          )}
        </div>
      </section>
    </div>
  );
};

export default Homepage;
